import 'bootstrap/dist/css/bootstrap.css';
import Dropdown from 'react-bootstrap/Dropdown';
import Form from 'react-bootstrap/Form';

export default function DataType() {
  const [display, setDisplay] = useState('Select');
  const mountOther = () => {
    this.state = {
      show: false
    };
  };
  const showOther = () => {
    this.setState({
      show: true
    })
  };
    return (
    <div style={{ display: 'block', 
                  width: 700, 
                  padding: 30 }}>
      <h4>Data Set Type: </h4>
      <div style={{ display: 'flex'}}>
      <Dropdown>
        <Dropdown.Toggle variant="primary">
          {display}
        </Dropdown.Toggle>
        <Dropdown.Menu>
          <Dropdown.Item href="#" onClick={() => setDisplay("Pk Study")}>
            Pk Study
          </Dropdown.Item>
          <Dropdown.Item href="#" onClick={() => setDisplay("IVT Study")}>
            IVT Study
          </Dropdown.Item>
          <Dropdown.Item href="#" onClick={showOther}>
            Other
          </Dropdown.Item>
        </Dropdown.Menu>
      </Dropdown>
      {
      <Form style={{  }}>
          <Form.Control type="text" placeholder="Enter Data Set Type" />
      </Form>
}
      </div>
    </div>
    );
}
